import SwiftUI
import SwiftUICharts

struct SLCChartView: View {
	static private let xAxisLabelIdTemplate = "xAxisLabel-%@"
	static private let channel1YAxisLabelIdTemplate = "channel1YAxisLabel-%@"
	static private let channel2YAxisLabelIdTemplate = "channel2YAxisLabel-%@"

	@StateObject
	var viewModel: SLCChartViewModel

	@EnvironmentObject
	var layoutManager: SLCChartLayoutManager

	@State
	private var chartSize: CGSize = .zero
	@State
	private var xLabelSize: CGSize = .zero
	@Namespace
	private var nameSpace: Namespace.ID

    var body: some View {
		HStack {
			GeometryReader { geo in
                ZStack(alignment: .leading) {
                    ForEach(viewModel.rangeCheckData, id: \.id) { rangeCheckChartData in
                        RangedLineChart(chartData: rangeCheckChartData)
                    }
                    ZStack {
                        LineChart(chartData: viewModel.channel1Data)
                        if viewModel.hasSecondChannel {
                            LineChart(chartData: viewModel.channel2Data)
                        }
                    }
                    .frame(width: geo.size.width * viewModel.chartWidthRatio)
                    Spacer(minLength: 0)
                        .frame(width: geo.size
                            .width * (1 - viewModel.chartWidthRatio))
                }
			}
		}
		.readSize($chartSize)
		.background {
			hGrid
			vGrid
		}
		.overlay(alignment: .leading, content: {
			channel1YAxisLabelsOverlay
		})
		.overlay(alignment: .trailing, content: {
			if viewModel.hasSecondChannel {
				channel2YAxisLabelsOverlay
			}
		})
		.overlay(alignment: .bottomLeading, content: {
			xAxisLabelsOverlay
		})
		.padding(8)
		.padding(.bottom, 28)
		.padding(.top, 16)
		.padding(.leading, layoutManager.channel1AxisLabelPadding())
		.padding(.trailing, layoutManager.channel2AxisLabelPadding(hasSecondChannel: viewModel.hasSecondChannel))
		.overlay(alignment: .topLeading) {
			unitLabel(viewModel.channel1Unit, foregroundColor: .blue, edges: [.top, .leading])
		}
		.overlay(alignment: .topTrailing) {
			if let channel2Unit = viewModel.channel2Unit {
				unitLabel(channel2Unit, foregroundColor: .green, edges: [.top, .trailing])
			}
		}
		.overlay(alignment: .bottom, content: {
			unitLabel("sec", foregroundColor: .primary, edges: .bottom)
		})
    }

	@ViewBuilder
	private var vGrid: some View {
		MultiLineChart(chartData: viewModel.vGridData)
			.frame(width: chartSize.height, height: chartSize.width)
			.rotationEffect(.degrees(90))
	}

	@ViewBuilder
	private var hGrid: some View {
		MultiLineChart(chartData: viewModel.hGridLineData)
			.frame(width: chartSize.width, height: chartSize.height)
	}

	@ViewBuilder
	private var channel1YAxisLabelsOverlay: some View {
		yAxisOverlay(
			.leading,
			values: viewModel.channel1YAxisValues,
			idTemplate: Self.channel1YAxisLabelIdTemplate,
			labelWidth: layoutManager.greatestsChannel1YLableWidth,
			labelSizes: $layoutManager.channel1YLabelSizes)
	}

	@ViewBuilder
	private var channel2YAxisLabelsOverlay: some View {
		yAxisOverlay(
			.trailing,
			values: viewModel.channel2YAxisValues,
			idTemplate: Self.channel2YAxisLabelIdTemplate,
			labelWidth: layoutManager.greatestsChannel2YLableWidth,
			labelSizes: $layoutManager.channel2YLabelSizes)
	}

	@ViewBuilder
	private var xAxisLabelsOverlay: some View {
		HStack {
			if let first = viewModel.xAxisValues.first {
				axisLabel(String(format: Self.xAxisLabelIdTemplate, first))
			}
			ForEach(viewModel.xAxisValues.dropFirst(), id: \.self) { value in
				Spacer()
				axisLabel(String(format: Self.xAxisLabelIdTemplate, value))
			}
		}
		.offset(y: xLabelSize.height / 2 + 4)
		.frame(width: chartSize.width * viewModel.xAxisValuesWidthMultiplier)
		.offset(x: viewModel.xAxisValuesXOffset(for: chartSize))
		.overlay {
			ForEach(viewModel.xAxisValues, id: \.self) {
				Text($0)
					.font(.caption)
					.readSize($xLabelSize)
					.matchedGeometryEffect(id: String(format: Self.xAxisLabelIdTemplate, $0), in: nameSpace, properties: [.position], isSource: false)
			}
		}
	}

	@ViewBuilder
	private func axisLabel(_ id: String) -> some View {
		Circle()
			.fill(.clear)
			.frame(width: 1, height: 1)
			.offset(x: -0.5, y: -0.5)
			.matchedGeometryEffect(id: id, in: nameSpace, isSource: true)
	}

	@ViewBuilder
	private func yAxisOverlay(_ edge: Edge, values: [String], idTemplate: String, labelWidth: CGFloat, labelSizes: Binding<[CGSize]>) -> some View {
		VStack {
			if let first = values.last {
				axisLabel(String(format: idTemplate, first))
			}
			ForEach(values.reversed().dropFirst(), id: \.self) { value in
				Spacer()
				axisLabel(String(format: idTemplate, value))
			}
		}
		.offset(x: (edge == .leading ? -1 : 1) * (labelWidth / 2 + 4))
		.frame(height: chartSize.height / viewModel.yAxisMultiplier)
		.overlay(content: {
			VStack(alignment: .trailing) {
				ForEach(values, id: \.self) { [labelSizes] value in
					HStack {
						if edge == .leading {
							Spacer(minLength: 0)
						}
						Text(value)
							.font(.caption)
							.fixedSize(horizontal: true, vertical: false)
							.setSizePreference()
							.onPreferenceChange(SizePreferenceKey.self) { newValue in
								guard !labelSizes.wrappedValue.contains(newValue) else {
									return
								}
								labelSizes.wrappedValue.append(newValue)
							}
						if edge == .trailing {
							Spacer(minLength: 0)
						}
					}
					.frame(width: labelWidth)
						.matchedGeometryEffect(id: String(format: idTemplate, value), in: nameSpace, properties: [.position], isSource: false)
				}
			}
		})
	}

	@ViewBuilder
	private func unitLabel(_ text: String, foregroundColor: Color, edges: Edge.Set) -> some View {
		Text(text)
			.font(.footnote)
			.fontWeight(.bold)
			.foregroundColor(foregroundColor)
			.padding(edges, 4)
	}
}

class SLCChartLayoutManager: ObservableObject {
	@Published
	var channel1YLabelSizes: [CGSize] = []
	@Published
	var channel2YLabelSizes: [CGSize] = []

	var greatestsChannel1YLableWidth: CGFloat {
		channel1YLabelSizes.map({ $0.width }).max() ?? 0
	}

	var greatestsChannel2YLableWidth: CGFloat {
		channel2YLabelSizes.map({ $0.width }).max() ?? 0
	}

	func channel1AxisLabelPadding() -> CGFloat {
		greatestsChannel1YLableWidth
	}

	func channel2AxisLabelPadding(hasSecondChannel: Bool) -> CGFloat {
		guard hasSecondChannel else {
			return 0
		}
		return greatestsChannel2YLableWidth
	}

	func resetChannel1LabelWidths() {
		channel1YLabelSizes.removeAll()
	}

	func resetChannel2LabelWidths() {
		channel2YLabelSizes.removeAll()
	}
}

