		}.environmentObject(SLCChartLayoutManager())
	}

	static func viewModel(_ range: Range<Int>? = nil, with2Channels: Bool = false) -> SLCChartViewModel {
		let viewModel = SLCChartViewModel(
			channel1: channel1Config,
			channel2: with2Channels ? channel2Config : nil,
            samplingRate: ._100, error: .constant(nil))
        viewModel.setStartDate(Date(timeIntervalSinceReferenceDate: channel1RawData.first?.0 ?? 0))
        
        channelRawData(range, from: channel1RawData)
            .forEach { dataPoint in
                viewModel.chartChannel1DataPoint((Date(timeIntervalSinceReferenceDate: dataPoint.0), dataPoint.1))
            }
        if with2Channels {
            channelRawData(range, from: channel2RawData)
                .forEach { dataPoint in
                    viewModel.chartChannel2DataPoint((Date(timeIntervalSinceReferenceDate: dataPoint.0), dataPoint.1))
                }
        }
		return viewModel
	}

	static let channel1Config = DeviceConfiguration.dualChannelMock!.channel(1)!

	static let channel2Config = DeviceConfiguration.dualChannelMock!.channel(2)!
    
